import React, { useState, useEffect } from 'react';
import { makeStyles } from '@material-ui/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import {Link} from 'react-router-dom';



const useStyles = makeStyles(theme => ({
  bar: {
    backgroundColor: theme.palette.common.gray,
    height: "5vh",
  },
  text: {
    color: "white",
    fontFamily: "Lato",
    fontSize: "0.8em",
  },
  tabContainer: {
    marginLeft: "auto",
    marginRight: "0"
  },
}))

export default function Footer(props) {
  const classes = useStyles();

  return (
    <React.Fragment>
      <Grid container spacing = {2} alignItems="stretch" justifyContent="center" className={classes.bar}>
        <Grid item xs={4}>
          <Typography className={classes.text} component="p" >Â© Copyright - AC Engineering, Inc. All Rights Reserved | Developed by Edward Briscoe</Typography>
        </Grid>
        <Grid item xs={4}>
        <Tabs className={classes.tabContainer}>
          <Tab className={classes.text} component={Link} to="/" label = "Home"/>
          <Tab className={classes.text} component={Link} to="/about" label = "About Us"/>
          <Tab className={classes.text} component={Link} to="/services" label = "Services"/>
          <Tab className={classes.text} component={Link} to="/mobiledatacenters" label = "Mobile Data Centers"/>
          <Tab className={classes.text} component={Link} to="/contact" label = "Contact Us"/>
        </Tabs>
        </Grid>
      </Grid>
    </React.Fragment>

  )
}
